import {useState} from 'react';

const Home = () => {
    const[name, setName]=useState('Josh');

    const handleClick=(name)=>{
        setName('Marty'); 
    }

    return (
        <div className="home">
            <h2>Homepage</h2>
            <p>{name}</p>
            <button onClick={()=> handleClick('Josh')}>Click me</button>
        </div>
    );
}

export default Home;
